import { styles } from "../styles";

export const themeOverWrites = theme => ({
    componentWrapper: {
        margin: "30px 0"
    },
    root: { ...styles(theme).root },
    whiteBg: {
        background: theme.palette.background.default,
        boxShadow: theme.shadows[8],
        padding: "30px"
    },
    darkBg: {
        background: "rgba(0, 0, 0, 0.6)",
        boxShadow: theme.shadows[8],
        color: "#fff",
        padding: "30px"
    }
});
